class Solution:
    def findDuplicate(self, nums):
        # 使用 Floyd's Tortoise and Hare (Cycle Detection) 演算法
        slow = fast = nums[0]

        # 第一階段: 找到相遇點
        while True:
            slow = nums[slow]
            fast = nums[nums[fast]]
            if slow == fast:
                break

        # 第二階段: 找到入環點（重複數字）
        slow = nums[0]
        while slow != fast:
            slow = nums[slow]
            fast = nums[fast]

        return slow
